+(NSString*) getCachePath
{
    //是获取文档目录的， NSDocumentDirectory换成NSCachesDirectory就是缓存的了
    NSArray *paths=NSSearchPathForDirectoriesInDomains(NSCachesDirectory,NSUserDomainMask,YES);
    NSString *directory = [paths objectAtIndex:0];
    NSString *result = @"";
    result = [directory stringByAppendingString:@"/"];
    return result;
}


+ (NSString*) getIDFA :(NSDictionary *)dict{
    NSString *adid = [[[ASIdentifierManager sharedManager] advertisingIdentifier] UUIDString];
    
    return adid;
}

+(void) getAudioPermission:(NSDictionary *)dict{
    int cb = [[dict objectForKey:@"cb"] intValue];
    cocos2d::LuaBridge::retainLuaFunctionById(cb);
    if (cb != 0) {
        cocos2d::LuaBridge::pushLuaFunctionById(cb);
        cocos2d::LuaBridge::getStack()->pushBoolean(NO);
        cocos2d::LuaBridge::getStack()->executeFunction(1);
        cocos2d::LuaBridge::releaseLuaFunctionById(cb);
        cb = 0;
    }

}

+(NSInteger) getNetWorkState:(NSDictionary *)dict{
    
    // 0是无网络 1是grps 2是wifi
    if([SGReachability reachabilityForInternetConnection].currentReachabilityStatus == ReachableViaWWAN)
    {
        return 1;
    }
    if([SGReachability reachabilityForInternetConnection].currentReachabilityStatus ==ReachableViaWiFi)
    {
        return 2;
        
    }
    
    return 0;
    
    
}

